import styles from './Education.module.css';
import EducationCard from './EducationCard';
import TopicName from './TopicName';
function Experience() {
    return (
        <div className={styles.wrapper} style={{background: " #323647"}}>
            <TopicName title="Experience"/>

            <div className={styles.school_wrapper}>
                <EducationCard
                    title="EOFool, Question Setter"
                    place="IIEST Shibpur, EOFool, Instruo 2025"
                    subtitle="October 2024"
                    info={[
                        "Set questions for capture the flag event (EOFool)",
                        "-",
                        "Ensured Smooth Conduction of the Event"
                    ]}
                />

                <EducationCard
                    title="Winter Of OpenSource, Operator"
                    place="IIEST Shibpur, CodeIIESTXGDG Event"
                    subtitle="December 2024, 2025"
                    info={[
                        "Created a leaderboard website that dynamically",
                        "fetched updates from score changes on GSheets (2024)",
                        "-",
                        "Maintaned Repositories for people to contribute (2024, 2025)"
                    ]}
                />
            </div>
            <div className={styles.school_wrapper}>
                <EducationCard
                    title="GDG Cybersecurity Lead"
                    place="IIEST Shibpur, GDG"
                    subtitle="2025-Present"
                    info={[
                        "As the the lead of the Cybersecurity Chapter,",
                        // "-",
                        "I have conducted various CTF events, took ",
                        "sessions involving linux and it's usecase",
                        "in the realm of cybersecurity, shown practical demonstrations",
                        // "demonstrations"

                    ]}
                />

                <EducationCard
                    title="Game Development"
                    place="IIEST Shibpur, CodeIIEST"
                    subtitle="January 2025-Present"
                    info={[
                        "Created a leaderboard website that dynamically",
                        "fetched updates from score changes on GSheets (2024)",
                        "-",
                        "Maintaned Repositories for people to contribute (2024, 2025)"
                    ]}
                />
            </div>
        </div>
    );
}

export default Experience;
